Ofcom requires the establishment of a ‘call-off’ Contract with 1 Tenderer for the provision of translation and transcription services.
 The Contract will require the following Services to be provided by the successful Tenderer:
 i. the translation and transcription of electronic media into MS Word documents;
 ii. the translation and transcription of documents into MS Word documents; and
 iii. the attendance, from time to time, of translators at Ofcom's London offices to translate and transcribe electronic media and documents into MS Word documents and to answer questions and provide information in relation to such translation and transcription assignments.
 Material to be translated and transcribed will include but not be limited to the following types:
 i. television programmes (including but not limited to the content of television programmes, onscreen text, subtitles and sponsorship credits);
 ii. radio programming;
 iii. on demand video content and written material on a website on which on demand content is made available;
 iv. broadcast advertisements; and
 v. supporting documentation that may be submitted as evidence during an investigation which may include handwritten complaint letters or complaint forms.
 The successful Tenderer will be required to provide a comprehensive, accurate and timely translation and transcription Services in excellent written English across a wide range of languages. The successful Tenderer must be able to provide comprehensive, accurate and timely translations in at least the languages listed in Table 3, Appendix 4 of the Invitation to Tender document.
 Background: Ofcom is the UK's communications regulator. It regulates the TV and radio sectors, fixed line telecoms, mobiles, postal services, the airwaves over which wireless devices operate and on demand programme services.

The objective is to establish a Framework Agreement for Orthotics Services and Consumables. This framework agreement covers 3 Lots outlined as follows:
Lot 1 Orthotics Consumables;
Lot 2 Orthotics Services;
Lot 3 Managed Service.

The framework will be awarded for and initial period of 2 years with the option to extend for a further period of 2 x 12 months making 4 years in duration in totality.

Lot 1: Orthotics Consumables
Othotics Consumables including Off the Shelf and Made to Measure Products.
Made to Measure Product include:
1 — Footwear Made to measure;
2 — Footwear Adaptations;
3 — Footwear repairs;
4 — Footwear modular/stock;
5 — Lower limb othoses;
6 — Surgical spring trusses ready made;
7 — Spinal orthoses (abdominal fabric supports);
8 — Upper limb othoses and special orthoses;
9 — Spinal othoses;
10 — Orthoses for head and neck;
11 — Common extras and repairs;
12 — Reciprocal walking orthoses
13 — Wigs;
14 — Hosiery.
Off the Shelf Products include:
1 — Cervical;
2 — Spine;
3 — Shoulder;
4 — Elbow and Arm;
5 — Wrist and Hand;
6 — Wrist and Thumb;
7 — Hips/Thigh/Calf;
8 — Knee;
9 — Ankle;
10 — Foot;
11 — Insoles;
12 — Casting and Traction;
13 — Paediatric;
14 — Accessories/Misc/…

Lot 2: Orthotics Service
For the provision of an Orthotist who will be expected to provide professional input into the team, in particular regarding the recommendation of the appropriate orthosis.

Lot 3: Orthotics Managed Services
For the provision of an Orthotic service, including the provision of an Orthotist and Orthotics Consumables for new and existing patients.

Brighton and Hove City Council (the Council), in partnership with Brighton and Hove Clinical Commissioning Group (the CCG),  invites expressions of interest from providers interested in offering specialist dementia nursing home beds within the boundaries of Brighton and Hove. 

The Council requires a minimum of 38 beds, to be available on a staggered basis from 1st April 2016. 

It is recognised that providers may not have the capacity to provide all 38 beds so the Council is interested in responses from providers than can offer a minimum of twenty beds.

The Council is interested in entering a block contract arrangement whereby availability and funding would be guaranteed for an initial period of three years.

Please note that this is not a tender process. The Council is currently investigating the level of interest, availability and indicative costings for this requirement. 

Please complete the form attached and return via email to: 
procurement@brighton-hove.gov.uk by 16:00 on Thursday 11th February 2016.

Requirements
•	Provision of a minimum of twenty Care Quality Commission (CQC) registered nursing homes beds in Brighton & Hove; 
•	To start placements from 1st April 2016 and build up capacity as beds become available;
•	A specialist dementia provider;
•	A suitable dementia environment and staff team trained to support people with dementia;
•	Referrals will be via the Brighton & Hove Care Matching Team, and will consist of publicly funded service users supported by the Council or Continuing Health Care Team, and self funding service users.
